import React, { Component } from "react";
import { HeaderWrapper, Logo, Nav } from "./style";

class Header extends Component {
  render() {
    return (
      <HeaderWrapper>
        <Logo></Logo>
        <Nav>
          <NavItem>
              首页
          </NavItem>
          <NavItem>
              下载App
          </NavItem>
          <NavItem>
            登录
          </NavItem>
          <NavItem>
              首页
          </NavItem>
        </Nav>
      </HeaderWrapper>
    )
  }
}
export default Header;
